INSERT INTO `instructions` (`id`, `recipe_id`, `step_number`, `instruction`, `image`, `created_at`, `updated_at`) VALUES
(4, 91, 1, '1. Pre-heat oven to 160°C/140°C fan-forced.', NULL, '2025-10-07 04:59:24.599', '2025-10-07 04:59:24.599'),
(5, 91, 2, '2. Place beef in a bowl with 1 tbs flour. Season, tossing to combine. Heat oil in a deep ovenproof frying pan over medium-high heat. Cook beef, in 2 batches, for 5 minutes, turning occasionally, or until browned. Transfer to a plate.', NULL, '2025-10-07 04:59:24.599', '2025-10-07 04:59:24.599'),
(6, 91, 3, '3. Add onion, thyme and bay leaves to pan. Cook, stirring frequently, for 8 minutes or until onion has softened. Add all-spice and remaining flour, then cook, stirring, for further 1 minute, And sherry (if using), Worcestershire sauce, stock and vinegar, then bring to the boil. Cook for 4 minutes or until reduced slightly. Return beef to pan. Cover, then transfer to the oven and cook for 2½ hours.', NULL, '2025-10-07 04:59:24.599', '2025-10-07 04:59:24.599'),
(7, 91, 4, '4. Preheat grill on high. Arrange baguette slices over beef mixture. Scatter over cheese. Grill for 5 minutes or until golden. Scatter over extra thyme and serve.', NULL, '2025-10-07 04:59:24.599', '2025-10-07 04:59:24.599'),
(8, 93, 1, '1. Heat oil in a large heavy-based saucepan over medium heat. Add onion and cook for 10 minutes or until softened. Add ginger, curry paste, cinnamon and cardamom. Cook, stirring, for 2 minutes or until fragrant.', NULL, '2025-10-07 14:25:13.114', '2025-10-07 14:25:13.114'),
(9, 93, 2, '2. Add pumpkin, tomato and coconut milk. Bring to a simmer and cook, partially covered, for 20 minutes, then add chickpeas. Simmer for a further 12 minutes or until pumpkin is tender. Stir in chopped coriander. Serve with rice, and topped with remaining coriander and chilli.', NULL, '2025-10-07 14:25:13.114', '2025-10-07 14:25:13.114'),
(10, 94, 1, 'Finely chop the spring onions. Peel and coarsely grate the carrots. Whisk the eggs in a bowl with the flour and soy sauce until smooth, then fold through the white part of the spring onions, stir-fry veg and grated carrot.', NULL, '2025-10-13 10:49:23.409', '2025-10-13 10:49:23.409'),
(11, 94, 2, 'Place a 28cm non-stick frying pan on a medium heat with 1 tsp of oil. Sprinkle in the sesame seeds so they cover the base. Pour the batter into the pan, cook for 5 minutes. Carefully turn the pancake out onto a plate, then slide it back in the pan to cook for a further 5 minutes on the other side or until cooked through.', NULL, '2025-10-13 10:49:23.409', '2025-10-13 10:49:23.409'),
(12, 94, 3, 'Skude tge okonomiyaki out onto a serving board with the sesame seed side facing up. Drizzle with the yoghurt , then scatter over the green part of the spring onions and chili flakes, if using. Cut into quarters and tuck in', NULL, '2025-10-13 10:49:23.409', '2025-10-13 10:49:23.409'),
(13, 95, 1, '1. Heat oil in a large heavy-based saucepan over medium heat. Add onion and cook for 10 minutes or until softened. Add ginger, curry paste, cinnamon and cardamom. Cook, stirring, for 2 minutes or until fragrant.', NULL, '2025-10-14 03:00:36.517', '2025-10-14 03:00:36.517'),
(14, 95, 2, '2. Add pumpkin, tomato and coconut milk. Bring to a simmer and cook, partially covered, for 20 minutes, then add chickpeas. Simmer for a further 12 minutes or until pumpkin is tender. Stir in chopped coriander. Serve with rice, and topped with remaining coriander and chilli.', NULL, '2025-10-14 03:00:36.517', '2025-10-14 03:00:36.517'),
(15, 96, 1, '1. Heat oil in a large heavy-based saucepan over medium heat. Add onion and cook for 10 minutes or until softened. Add ginger, curry paste, cinnamon and cardamom. Cook, stirring, for 2 minutes or until fragrant.', NULL, '2025-10-20 16:21:40.408', '2025-10-20 16:21:40.408'),
(16, 96, 2, '2. Add pumpkin, tomato and coconut milk. Bring to a simmer and cook, partially covered, for 20 minutes, then add chickpeas. Simmer for a further 12 minutes or until pumpkin is tender. Stir in chopped coriander. Serve with rice, and topped with remaining coriander and chilli.', NULL, '2025-10-20 16:21:40.408', '2025-10-20 16:21:40.408');

