(91, 76, 1, 'French Onion Beef Stew', 'french-onion-beef-stew-1e2b0b0b', 'this is the best!!!', '1. Pre-heat oven to 160°C/140°C fan-forced.\r\n2. Place beef in a bowl with 1 tbs flour. Season, tossing to combine. Heat oil in a deep ovenproof frying pan over medium-high heat. Cook beef, in 2 batches, for 5 minutes, turning occasionally, or until browned. Transfer to a plate.\r\n3. Add onion, thyme and bay leaves to pan. Cook, stirring frequently, for 8 minutes or until onion has softened. Add all-spice and remaining flour, then cook, stirring, for further 1 minute, And sherry (if using), Worcestershire sauce, stock and vinegar, then bring to the boil. Cook for 4 minutes or until reduced slightly. Return beef to pan. Cover, then transfer to the oven and cook for 2½ hours.\r\n4. Preheat grill on high. Arrange baguette slices over beef mixture. Scatter over cheese. Grill for 5 minutes or until golden. Scatter over extra thyme and serve.', 15, 180, 4, 'HARD', 'main-course', 'french', '/uploads/recipes/0a3d3bec-4ed5-4693-a01a-57205f3c9467.jpg', 0, 0, 'PUBLISHED', 0, '2025-10-07 04:59:24.599', '2025-10-13 08:53:07.000', 'approved', NULL, NULL, NULL, NULL, NULL, '2025-10-07 04:59:24.599', 0, NULL, NULL, 0, 0),
(93, 76, 1, 'Indian Pumpkin and Chickpea Curry', 'indian-pumpkin-and-chickpea-curry-d881a698', 'Curry yesss point 3!!', '1. Heat oil in a large heavy-based saucepan over medium heat. Add onion and cook for 10 minutes or until softened. Add ginger, curry paste, cinnamon and cardamom. Cook, stirring, for 2 minutes or until fragrant.\r\n2. Add pumpkin, tomato and coconut milk. Bring to a simmer and cook, partially covered, for 20 minutes, then add chickpeas. Simmer for a further 12 minutes or until pumpkin is tender. Stir in chopped coriander. Serve with rice, and topped with remaining coriander and chilli.', 10, 45, 4, 'MEDIUM', 'main-course', 'indian', '/uploads/recipes/bd8bb025-5892-43fe-942c-1d032d574cb1.jpg', 0, 0, 'PUBLISHED', 0, '2025-10-07 14:25:13.114', '2025-10-07 14:25:53.000', 'approved', NULL, NULL, NULL, NULL, NULL, '2025-10-07 14:25:13.114', 1, 200.00, 'you should try this recipe you will love it!!!', 0, 0),
(94, 6, 1, 'OKONOMIYAKI', 'okonomiyaki-0ed850ba', 'This Japanese-style savoury pancake is a joy to eat. Quick, easy and versatile', 'Finely chop the spring onions. Peel and coarsely grate the carrots. Whisk the eggs in a bowl with the flour and soy sauce until smooth, then fold through the white part of the spring onions, stir-fry veg and grated carrot.\r\nPlace a 28cm non-stick frying pan on a medium heat with 1 tsp of oil. Sprinkle in the sesame seeds so they cover the base. Pour the batter into the pan, cook for 5 minutes. Carefully turn the pancake out onto a plate, then slide it back in the pan to cook for a further 5 minutes on the other side or until cooked through.\r\nSkude tge okonomiyaki out onto a serving board with the sesame seed side facing up. Drizzle with the yoghurt , then scatter over the green part of the spring onions and chili flakes, if using. Cut into quarters and tuck in', 5, 15, 4, 'EASY', 'Lunch', 'Japanese', '/uploads/recipes/939ee582-72e3-4d47-a69d-e009d7638ed9.jpg', 0, 0, 'PUBLISHED', 0, '2025-10-13 10:49:23.409', '2025-10-14 02:13:17.000', 'approved', NULL, NULL, NULL, NULL, NULL, '2025-10-13 10:49:23.409', 0, NULL, NULL, 0, 0),
(95, 6, 1, 'Indian Pumpkin and Chickpea Curry', 'indian-pumpkin-and-chickpea-curry-60237750', 'Curry yesss point 3!!', '1. Heat oil in a large heavy-based saucepan over medium heat. Add onion and cook for 10 minutes or until softened. Add ginger, curry paste, cinnamon and cardamom. Cook, stirring, for 2 minutes or until fragrant.\r\n\r\n2. Add pumpkin, tomato and coconut milk. Bring to a simmer and cook, partially covered, for 20 minutes, then add chickpeas. Simmer for a further 12 minutes or until pumpkin is tender. Stir in chopped coriander. Serve with rice, and topped with remaining coriander and chilli.', 10, 45, 4, 'MEDIUM', 'main-course', 'indian', '/uploads/recipes/bd8bb025-5892-43fe-942c-1d032d574cb1.jpg', 0, 0, 'PUBLISHED', 0, '2025-10-14 03:00:36.517', '2025-10-15 05:48:03.000', 'rejected', NULL, NULL, NULL, NULL, NULL, '2025-10-14 03:00:36.517', 0, NULL, NULL, 0, 0),
(96, 6, 1, 'Indian Pumpkin and Chickpea Curry', 'indian-pumpkin-and-chickpea-curry-03d16c07', 'Curry yesss point 3!!', '1. Heat oil in a large heavy-based saucepan over medium heat. Add onion and cook for 10 minutes or until softened. Add ginger, curry paste, cinnamon and cardamom. Cook, stirring, for 2 minutes or until fragrant.\r\n\r\n2. Add pumpkin, tomato and coconut milk. Bring to a simmer and cook, partially covered, for 20 minutes, then add chickpeas. Simmer for a further 12 minutes or until pumpkin is tender. Stir in chopped coriander. Serve with rice, and topped with remaining coriander and chilli.', 10, 45, 4, 'MEDIUM', 'main-course', 'indian', '/uploads/recipes/bd8bb025-5892-43fe-942c-1d032d574cb1.jpg', 0, 0, 'PUBLISHED', 0, '2025-10-20 16:21:40.408', '2025-10-20 16:21:40.408', 'pending', NULL, NULL, NULL, NULL, NULL, '2025-10-20 16:21:40.408', 0, NULL, NULL, 0, 0);

